import React, {Component} from 'react';
import Layout from '../../components/Layout';
class TrustfundShow extends Component{
render() {
      return (
        <Layout>
            <h3>Trust Fund show</h3>
        </Layout>
      );
    }
}
export default TrustfundShow;
